export const Products = ({ state, dispatch }) => {
  const { products, cart } = state;
  return (
    <div
      style={{
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'space-evenly',
        width: '80%',
      }}
    >
      {products.map((pro) => {
        <div
          key={pro.id}
          style={{
            display: 'flex',
            flexDirection: 'column',
            padding: 10,
            border: '1px solid grey',
            marginTop: 10,
            gap: 10,
            width: '30%',
          }}
        ></div>;
      })}
    </div>
  );
};
